import calendaricon from "../images/calendar_icon.png";
function SearchFilter(props) {

    return(
        <div className="SearchFilter">
            <img src={calendaricon}/>
            <label>Destination<br></br> <input type="text" value={props.searchDestination} onChange={props.searchDestinationChange}/></label>
            <label>Check in<br></br> <input type="date" value={props.searchCheckInDate} onChange={props.searchCheckInDateChange}/></label>
            <label>Check out<br></br> <input type="date" onChange={props.searchCheckOutDateChange}/></label>
            <label>Guests<br></br> <input type="number" onChange={props.searchGuestsChange}/></label>
            <label>Check availability<br></br> <button onClick={props.searchHotels}>Check</button></label>
        </div>
    )
}

export default SearchFilter;
// Exporterar komponenten som "SearchFilter".
